function LogOutBtn(props) {
  const style = {
    margin: "2rem auto",
    display: "block",
    backgroundColor: "white",
  };

  return (
    <div>
      <button
        className="main-header-buttons"
        style={style}
        onClick={props.actionTunnel}
      >
        <strong>LOGOUT</strong>
      </button>
    </div>
  );
}

export default LogOutBtn;
